import * as React from "react";
import TextareaAutosize from "@mui/base/TextareaAutosize";

export default function Textarea() {
  return (
    <TextareaAutosize
      aria-label="minimum height"
      minRows={5}
      placeholder="Enter your text here"
      //   style={{ width: 1000 }}
      marginleft={10}
      margintop={10}
    />
  );
}
